    <title>Verkefni 1</title>

    <style>
      body {
        background: #263238;
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
        margin: 0;
      }

      #dog {
        cursor: pointer;
      }

      svg,
      g {
        transform-origin: center;
      }

      #planet-rotate {
        transform-origin: 50% 50%;
        transform-box: fill-box;
      }

      .four04 {
        cursor: pointer;
      }
    </style>

  <body>
    <script type="module">
      import {
        animate,
        createTimeline,
        svg,
      } from "https://cdn.jsdelivr.net/npm/animejs/+esm";

      const dog = document.getElementById("dog");
      const helmet = document.getElementById("helmet");

      const one404 = document.getElementById("404-1");
      const two404 = document.getElementById("404-2");

      const timeline = createTimeline({ defaults: { duration: 1750 } });
      // Animate the comet
      timeline.add("#comet-2", {
        y: [{ from: 30, ease: "outExpo" }],
        x: [{ from: 30, ease: "outExpo" }],
        opacity: [{ to: 1, ease: "outExpo" }],
        easing: "outExpo",
      });
      timeline.add(
        "#comet-1",
        {
          y: [{ from: 30, ease: "outExpo" }],
          x: [{ from: 30, ease: "outExpo" }],
          opacity: [{ to: 1, ease: "outExpo" }],
          easing: "outExpo",
        },
        350
      );
      timeline.add(
        "#planet-rotate",
        {
          rotate: 360,
          easing: "linear",
          duration: 7500,
          loop: true,
        },
        500
      );

      timeline.play();

      dog.onmouseover = () => {
        animate(dog, {
          translateY: -10,
          duration: 500,
          easing: "easeOutQuad",
        });
        animate(helmet, {
          opacity: 1,
          duration: 500,
          easing: "easeOutQuad",
        });
      };

      dog.onmouseleave = () => {
        animate(dog, {
          translateY: 0,
          duration: 500,
          easing: "easeOutQuad",
        });
        animate(helmet, {
          opacity: 0,
          duration: 500,
          easing: "easeOutQuad",
        });
      };

      one404.onmouseover = () => {
        animate(one404, {
          translateY: -15,
          duration: 500,
          easing: "easeOutQuad",
        });
      };

      one404.onmouseleave = () => {
        animate(one404, {
          translateY: 0,
          duration: 500,
          easing: "easeOutQuad",
        });
      };

      two404.onmouseover = () => {
        animate(two404, {
          translateY: -15,
          duration: 500,
          easing: "easeOutQuad",
        });
      };

      two404.onmouseleave = () => {
        animate(two404, {
          translateY: 0,
          duration: 500,
          easing: "easeOutQuad",
        });
      };

      animate(svg.createDrawable("#string"), {
        draw: ["0 0", "0 1"],
        ease: "inOutQuad",
        duration: 2000,
      });
    </script>
